import './App.css';
import { useState } from 'react';

function App() {

  const [delta,setDelta] = useState()

  function ChangeNumber(event){
    console.log(event);
    setDelta(Number(event.target.value))
  }


  return (
    <div className="App">
      <input type = "number" value={delta} onChange = {ChangeNumber}/>
      <button>submit</button>
    </div>
  );
}

export default App;
